import axios from "axios";
import {url} from './../constants/auth'

export const Login = async (username, password) => {

    try {
        const data = await axios.post(url + "/auth", {
            username,
            password
        })
        console.log('caegoyt', data)
        if (!data.data.error) {
            return true
        }
        else {
            return false
        }
    }
    catch (error) {
        if (error) {
            return false
        }
    }
}
